import React from 'react';
import { Nav, NavbarContainer, NavLogo }  from './NavbarElement';


const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <NavLogo to="/">Study Joa</NavLogo>
                    <h1>Hey</h1>
                </NavbarContainer>
            </Nav>
        </>
    );
};

export default Navbar;
